import { createStore, applyMiddleware } from "redux";
import { composeWithDevTools } from "redux-devtools-extension";
import thunk from "redux-thunk";
import rootReducer2 from "./reducers2/alert2";
import rootReducer3 from "./reducers2/auth2";
import rootReducer4 from "./reducers2/index2";

const initialState = {};

const middleware2 = [thunk];

const store2 = createStore(
	rootReducer2,
	rootReducer3,
	rootReducer4,
	initialState,
	composeWithDevTools(applyMiddleware(...middleware2))
);
export default store2;
